Фирма "Amway" была создана в 1959 году. Ее основатели Рич де Вое и Жак ван Андел. 
Сегодня компания Amway – это общепризнанный лидер мирового масштаба в области прямых продаж. Компания производит товары широкого потребления для домашнего хозяйства, красоты и здоровья. Ведущие предприятия Америки, Европы и Азии специально для "Amway" выпускают продукцию, получившую заслуженное признание и популярность уже более чем в 80 странах мира. Лидирующие позиции по объемам потребления на душу населения и динамике роста занимает Япония - высокоразвитая страна, где особенно щепетильно относятся к вопросам здоровья. Поэтому экологически чистая, т.е. безопасная для окружающей среды и человека, продукция фирмы "Amway" по достоинству оценена жителями Страны восходящего солнца.

Более тысячи видов продукции собственного производства - хозяйственные чистящие и моющие средства, средства личной гигиены, парфюмерия, косметика фирмы "Artistry", витамины "NUTRIUTE" и другие созданы благодаря богатству растительного мира: редчайшим растениям и лекарственным травам Амазонии, а также специально выращиваемым на собственных плантациях зеленым насаждениям.

Именно за высокое качество продукции, ее экологическую безопасность и огромный вклад в охрану окружающей среды фирма была удостоена премий ООН, НАСА, ЮНЕСКО, "Гринпис". Среди прочих наград самыми значительными являются почетная премия ООН по защите окружающей среды 1989 года и почетный диплом организации Объединенная Земля (United Earth Certificate of Commendation) 1993 года.

Наиболее важные характеристики продукции Amway: 
высокая концентрация, т.е. экономичное использование;
• растительные концентраты; 
экологически безопасная продукция, подвергающаяся разложению микроорганизмами; 
перерабатываемая упаковка.
